import React from "react";
import Title from "./component/Title";
import MainModule from "./component/MainModules";
import componentStyle from "./index.module.css";

export default class FirstPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = { showNext: false };
  }
  render() {
    return (
      <div className={componentStyle.container}>
        {/* <div></div>
        <div></div>
        <div></div>
        <div></div>
        <div></div> */}
        <div
          className={componentStyle["heading-primary"]}
          style={{ top: this.state.showNext ? "1%" : "40%" }}
        >
          <Title goAhead={this.goAhead} />
        </div>
        <div className={componentStyle.MainModule}>
          <MainModule showNext={this.state.showNext} />
        </div>
      </div>
    );
  }

  goAhead = () => {
    this.setState({ showNext: true });
  };
}
